            $criteria->setDbName(MovimientoBancoPeer::DATABASE_NAME);
        }

        MovimientoBancoPeer::addSelectColumns($criteria);
        $startcol = MovimientoBancoPeer::NUM_HYDRATE_COLUMNS;
        EmpresaPeer::addSelectColumns($criteria);

        $criteria->addJoin(MovimientoBancoPeer::EMPRESA_ID, EmpresaPeer::ID, $join_behavior);

