        foreach (sfMixer::getCallables(self::getMixerPreSelectHook(__FUNCTION__)) as $sf_hook)
        {
          call_user_func($sf_hook, 'BaseMovimientoBancoPeer', $criteria, $con);
        }

        $stmt = BasePeer::doSelect($criteria, $con);
        $results = array();

        while ($row = $stmt->fetch(PDO::FETCH_NUM)) {
            $key1 = MovimientoBancoPeer::getPrimaryKeyHashFromRow($row, 0);
            if (null !== ($obj1 = MovimientoBancoPeer::getInstanceFromPool($key1))) {
